import React, { useState, useEffect } from "react";
import { getMapData } from "./api";
import "./styles.css";

function App() {
  const [imageUrl, setImageUrl] = useState("");

  useEffect(() => {
    const fetchData = async () => {
      const url = await getMapData();
      if (url) {
        setImageUrl(url);
      }
    };
    fetchData();
  }, []);

  return (
    <div className="container">
      <h1>Coastal Erosion Analysis</h1>
      {imageUrl ? (
        <img src={imageUrl} alt="Coastal Image" className="map-image" />
      ) : (
        <p>Loading map data...</p>
      )}
    </div>
  );
}

export default App;
